import { CheckOutlined } from '@ant-design/icons';
import dayjs from 'dayjs';

const formatDuration = (minutes) => {
  const hours = Math.floor(minutes / 60);
  const mins = minutes % 60;
  return `${hours}:${mins.toString().padStart(2, '0')}`;
};

const formatDateTime = (time) => {
  // Extract date and time if in format "MM-DD HH:mm"
  const match = time.match(/(\d{2}-\d{2})\s+(\d{2}:\d{2})/);
  if (!match) return time;

  const [_, mmdd, hhmm] = match;
  const [month, day] = mmdd.split('-');
  
  return `${hhmm} ${month}/${day}`;
};

export const getSegmentColumns = (onFlightSelect, startDay) => {
  // If no startDay provided, log error but continue with current date
  if (!startDay) {
    console.error('No startDay provided to getSegmentColumns');
    startDay = dayjs().startOf('day');
  }

  const baseDayjs = dayjs(startDay).startOf('day');
  
  console.log('\ngetSegmentColumns using startDay:', {
    startDay: baseDayjs.format('YYYY-MM-DD'),
    isValid: baseDayjs.isValid()
  });

  return [
    {
      title: '',
      dataIndex: 'select',
      width: 30,
      render: (_, record) => (
        <input 
          type="checkbox" 
          checked={!!record.isSelected}
          onChange={() => {
            onFlightSelect(record, record.segmentIndex);
          }}
        />
      )
    },
    { 
      title: 'From',
      dataIndex: 'from',
      width: 40,
      sorter: (a, b) => a.from.localeCompare(b.from)
    },
    { 
      title: 'To',
      dataIndex: 'to',
      width: 40,
      sorter: (a, b) => a.to.localeCompare(b.to)
    },
    { 
      title: 'Flight #', 
      dataIndex: 'flightNumber', 
      width: 60,
      sorter: (a, b) => a.flightNumber.localeCompare(b.flightNumber)
    },
    { 
      title: 'Airlines', 
      dataIndex: 'airlines', 
      width: 240,
      sorter: (a, b) => a.airlines.localeCompare(b.airlines),
      render: (text, record) => {
        const airlineCode = record.flightNumber.substring(0, 2);
        const imagePath = `${process.env.PUBLIC_URL}/${airlineCode}.png`;
        
        return (
          <div style={{ display: 'flex', alignItems: 'center', gap: '8px' }}>
            <img 
              src={imagePath}
              alt={airlineCode}
              style={{ 
                width: '24px', 
                height: '24px',
                objectFit: 'contain'
              }} 
              onError={(e) => {
                e.target.style.display = 'none';
              }}
            />
            {text}
          </div>
        );
      }
    },
    { 
      title: 'Duration',
      dataIndex: 'duration',
      width: 40,
      sorter: (a, b) => a.duration - b.duration,
      render: (duration) => formatDuration(duration)
    },
    { 
      title: 'Aircraft', 
      dataIndex: 'aircraft', 
      width: 240,
      sorter: (a, b) => a.aircraft.localeCompare(b.aircraft)
    },
    { 
      title: 'Departs', 
      dataIndex: 'departs', 
      width: 40,
      defaultSortOrder: 'ascend',
      render: formatDateTime,
      sorter: (a, b) => {
        const aMatch = a.departs.match(/(\d{2}-\d{2})\s+(\d{2}:\d{2})/);
        const bMatch = b.departs.match(/(\d{2}-\d{2})\s+(\d{2}:\d{2})/);
        if (!aMatch || !bMatch) return 0;
        
        const aDate = dayjs(`2025-${aMatch[1]} ${aMatch[2]}`);
        const bDate = dayjs(`2025-${bMatch[1]} ${bMatch[2]}`);
        return aDate.valueOf() - bDate.valueOf();
      }
    },
    { 
      title: 'Arrives', 
      dataIndex: 'arrives', 
      width: 40,
      render: formatDateTime,
      sorter: (a, b) => {
        const aMatch = a.arrives.match(/(\d{2}-\d{2})\s+(\d{2}:\d{2})/);
        const bMatch = b.arrives.match(/(\d{2}-\d{2})\s+(\d{2}:\d{2})/);
        if (!aMatch || !bMatch) return 0;
        
        const aDate = dayjs(`2025-${aMatch[1]} ${aMatch[2]}`);
        const bDate = dayjs(`2025-${bMatch[1]} ${bMatch[2]}`);
        return aDate.valueOf() - bDate.valueOf();
      }
    },
    { 
      title: 'Economy', 
      dataIndex: 'economy', 
      width: 40,
      align: 'center',
      sorter: (a, b) => (a.economy === b.economy ? 0 : a.economy ? -1 : 1),
      render: hasClass => hasClass ? <CheckOutlined style={{ color: '#52c41a' }} /> : null
    },
    { 
      title: 'Business', 
      dataIndex: 'business', 
      width: 40,
      align: 'center',
      sorter: (a, b) => (a.business === b.business ? 0 : a.business ? -1 : 1),
      render: hasClass => hasClass ? <CheckOutlined style={{ color: '#52c41a' }} /> : null
    },
    { 
      title: 'First', 
      dataIndex: 'first', 
      width: 40,
      align: 'center',
      sorter: (a, b) => (a.first === b.first ? 0 : a.first ? -1 : 1),
      render: hasClass => hasClass ? <CheckOutlined style={{ color: '#52c41a' }} /> : null
    }
  ];
};
